CREATE TABLE IF NOT EXISTS `product_accessories` (
  `accessoryID` int(111) NOT NULL AUTO_INCREMENT,
  `category_id` int(111) NOT NULL,
  `brand_id` int(111) NOT NULL,
  `accessoriesToken` text NOT NULL,
  `price` int(11) NOT NULL,
  `accessory_qty` int(11) NOT NULL,
  `visibility` int(2) NOT NULL DEFAULT '1',
  `accessory_name` text NOT NULL,
  `accessory_description` text NOT NULL,
  `accessory_image` text NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`accessoryID`)
) ENGINE=MyISAM AUTO_INCREMENT=47 DEFAULT CHARSET=latin1;






CREATE TABLE IF NOT EXISTS `product_attribute` (
  `product_attributeID` int(111) NOT NULL AUTO_INCREMENT,
  `attributeID` int(111) NOT NULL,
  `product_id` int(111) NOT NULL,
  `attribute_value` text NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`product_attributeID`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;






CREATE TABLE IF NOT EXISTS `product_order` (
  `orderID` int(111) NOT NULL AUTO_INCREMENT,
  `OrderNumber` varchar(255) NOT NULL,
  `invoiceNumber` varchar(255) DEFAULT NULL,
  `product_id` int(111) NOT NULL,
  `dealerID` int(111) NOT NULL,
  `specialOrderID` int(111) NOT NULL DEFAULT '0',
  `variationID` int(111) NOT NULL,
  `finance` int(2) NOT NULL DEFAULT '0',
  `batch` varchar(255) NOT NULL,
  `product_color` varchar(150) NOT NULL,
  `qty` int(111) NOT NULL,
  `orderQty` int(11) NOT NULL,
  `qtystatus` text NOT NULL,
  `orderStatus` varchar(100) NOT NULL DEFAULT 'pending',
  `delivery_date` date DEFAULT NULL,
  `discount` varchar(10) NOT NULL,
  `real_price` varchar(10) NOT NULL DEFAULT '0',
  `sale_price` varchar(11) NOT NULL DEFAULT '0',
  `final_price` varchar(11) NOT NULL DEFAULT '0',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`orderID`)
) ENGINE=MyISAM AUTO_INCREMENT=648 DEFAULT CHARSET=latin1;






CREATE TABLE IF NOT EXISTS `product_order_details` (
  `orderDetailID` int(111) NOT NULL AUTO_INCREMENT,
  `orderID` varchar(111) NOT NULL,
  `dealerID` varchar(111) NOT NULL,
