(3, 2, 10, 'lsbx-u516-lo1v-upal', 108, 15, 1, 'Cover Mate 1 Cover Lifter', '<p style=\"color: rgb(15, 70, 130); font-family: \" open=\"\" sans\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 22.4px;=\"\" outline:=\"\" none=\"\" !important;\"=\"\">Suggested RRP £189.99</p><p style=\"color: rgb(15, 70, 130); font-family: \" open=\"\" sans\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 22.4px;=\"\" outline:=\"\" none=\"\" !important;\"=\"\"><br></p><p style=\"color: rgb(15, 70, 130); font-family: \" open=\"\" sans\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 22.4px;=\"\" outline:=\"\" none=\"\" !important;\"=\"\">Step up your cover lift offering with the CoverMate I. This is simply the highest quality and most sold cover lift on the market. Its time-tested performance, attractive appearance and obvious quality is apparent to everyone desiring a no-hassle cover lift. Enjoy great customer satisfaction with the CoverMate I.</p><h3 style=\"font-family: \" open=\"\" sans\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" color:=\"\" rgb(12,=\"\" 165,=\"\" 224);=\"\" margin-bottom:=\"\" 4px;=\"\" font-size:=\"\" 1.8rem;=\"\" text-transform:=\"\" uppercase;=\"\" outline:=\"\" none=\"\" !important;\"=\"\">FEATURES & SPECS</h3><ul style=\"padding-left: 0px; color: rgb(15, 70, 130); font-family: \" open=\"\" sans\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 22.4px;=\"\" outline:=\"\" none=\"\" !important;\"=\"\"><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\" ..=\"\" images=\"\" bluecross.svg\")=\"\" left=\"\" 5px=\"\" no-repeat=\"\" scroll=\"\" transparent;\"=\"\">Requires just 10 to 15 inches of clearance behind the spa</li><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\" ..=\"\" images=\"\" bluecross.svg\")=\"\" left=\"\" 5px=\"\" no-repeat=\"\" scroll=\"\" transparent;\"=\"\">Available with specialty brackets that are designed specifically for certain spa brands</li><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\" ..=\"\" images=\"\" bluecross.svg\")=\"\" left=\"\" 5px=\"\" no-repeat=\"\" scroll=\"\" transparent;\"=\"\">Available with extended pivot arms and extended brackets for larger spas</li><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\" ..=\"\" images=\"\" bluecross.svg\")=\"\" left=\"\" 5px=\"\" no-repeat=\"\" scroll=\"\" transparent;\"=\"\">Powder-coated aluminum tubing with easy-to-install, non-corrosive composite mounting brackets</li><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\" ..=\"\" images=\"\" bluecross.svg\")=\"\" left=\"\" 5px=\"\" no-repeat=\"\" scroll=\"\" transparent;\"=\"\">Comes standard with a TowelMate accessory for hanging up to three towels right where you need them most</li></ul>', 'crmaccessory_36771.jpg', '2016-11-26 10:19:42', '2017-01-31 12:58:41', NULL),
(4, 2, 10, '2qdg-0vfx-71ok-dgsa', 121, 4, 1, 'Cover Caddy Cover Lifter', '<p><span style=\"color: rgb(0, 0, 0); font-family: \" pt=\"\" sans=\"\" narrow\",=\"\" arial,=\"\" helvetica,=\"\" sans-serif;=\"\" font-size:=\"\" 18px;=\"\" line-height:=\"\" 28px;=\"\" text-align:=\"\" center;\"=\"\">Suggested RRP £269.00</span></p><p><span style=\"color: rgb(0, 0, 0); font-family: \" pt=\"\" sans=\"\" narrow\",=\"\" arial,=\"\" helvetica,=\"\" sans-serif;=\"\" font-size:=\"\" 18px;=\"\" line-height:=\"\" 28px;=\"\" text-align:=\"\" center;\"=\"\"><br></span></p><p><span style=\"color: rgb(0, 0, 0); font-family: \" pt=\"\" sans=\"\" narrow\",=\"\" arial,=\"\" helvetica,=\"\" sans-serif;=\"\" font-size:=\"\" 18px;=\"\" line-height:=\"\" 28px;=\"\" text-align:=\"\" center;\"=\"\">The </span><span style=\"color: rgb(0, 0, 0); font-family: \" pt=\"\" sans=\"\" narrow\",=\"\" arial,=\"\" helvetica,=\"\" sans-serif;=\"\" font-size:=\"\" 18px;=\"\" line-height:=\"\" 28px;=\"\" text-align:=\"\" center;\"=\"\">Cover Caddy</span><span style=\"color: rgb(0, 0, 0); font-family: \" pt=\"\" sans=\"\" narrow\",=\"\" arial,=\"\" helvetica,=\"\" sans-serif;=\"\" font-size:=\"\" 18px;=\"\" line-height:=\"\" 28px;=\"\" text-align:=\"\" center;\"=\"\"> gas spring assisted cover lift defines versatility and effortless spa cover removal. Its unique design allows for installation on an array of spa shapes and sizes including round, octagonal, and spas with large radius or cut corners. The Caddys new under-mount base plate provides for a complete installation within minutes. The addition of a powerful gas spring makes lifting and lowering your spa cover easier than you ever imagined.</span><br></p><p><span style=\"color: rgb(0, 0, 0); font-family: \" pt=\"\" sans=\"\" narrow\",=\"\" arial,=\"\" helvetica,=\"\" sans-serif;=\"\" font-size:=\"\" 18px;=\"\" line-height:=\"\" 28px;=\"\" text-align:=\"\" center;\"=\"\"><br></span></p><ul style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: 20.02px;\"><li>New undermount-cabinet design works with all spas.</li><li>Gas spring assisted for effortless spa cover removal.</li><li>Stores cover conveniently to the side of your spa.</li><li>Adjustable  raises or lowers spa cover when stored.</li><li>Constructed of high-grade powder coated aluminum.</li><li>Complete installation within minutes.</li><li>Features an industry leading five year warranty.</li><li>XL spacers included for spa covers with 6?  4? tapers.</li><li>Works with spas from 30? to 40? in height</li><li>(Swim Spa Conversion Kit available for spas 41? to 55? tall)</li></ul>', 'crmaccessory_38283.jpg', '2016-11-26 10:23:44', '2017-01-10 16:24:49', NULL),
(5, 2, 10, '40k3-3las-02hn-8nqy', 141, 9, 1, 'Cover Valet CV250 Cover Lifter', '<div><span style=\"color: rgb(4, 117, 93); font-family: \" pt=\"\" sans=\"\" narrow\",=\"\" arial,=\"\" helvetica,=\"\" sans-serif;=\"\" font-size:=\"\" 18px;=\"\" line-height:=\"\" 28px;=\"\" text-align:=\"\" center;\"=\"\">Suggested RRP £259.99</span></div><div><span style=\"color: rgb(4, 117, 93); font-family: \" pt=\"\" sans=\"\" narrow\",=\"\" arial,=\"\" helvetica,=\"\" sans-serif;=\"\" font-size:=\"\" 18px;=\"\" line-height:=\"\" 28px;=\"\" text-align:=\"\" center;\"=\"\"><br></span></div><div><span style=\"color: rgb(4, 117, 93); font-family: \" pt=\"\" sans=\"\" narrow\",=\"\" arial,=\"\" helvetica,=\"\" sans-serif;=\"\" font-size:=\"\" 18px;=\"\" line-height:=\"\" 28px;=\"\" text-align:=\"\" center;\"=\"\">The Cover Valet is the worlds leading premium spa cover removal system. It is designed to fit in almost any backyard environment: inside of a gazebo, against a wall, or even mounted into an existing deck. Dual gas springs assist in effortlessly lifting and lowering the spa cover. A locking safety feature holds the cover open until it is time to be closed. A durable powder coat finish accompanied by stainless steel hardware allows the Cover Valet to be equipped with an industry leading 5 year warranty.</span><span style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: 20.02px;\"><br></span></div><div><span style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: 20.02px;\"><br></span></div><div><span style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: 20.02px;\"><br></span></div><ul style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: 20.02px;\"><li>Requires only 4?-6? of clearance.</li><li>Works inside most gazebos</li><li>Mounts to edge of spa cabinet or directly to deck</li><li>When cover is open, it doubles as a privacy wall.</li><li>Durable zinc plated and powder coated finish.</li><li>Highest quality stainless steel hardware.</li><li>Accessory brackets are available to fit specific spa manufacturers needs.</li><li>Compact packaging for easy, low-cost shipping and handling.</li><li>Features a five year limited manufacturers warranty.</li></ul>', 'crmaccessory_65465.jpg', '2016-11-26 10:28:53', '2016-12-21 13:17:53', NULL),
(6, 2, 10, 'likk-d2fe-7c75-2r8a', 160, 3, 1, 'Covermate III Freestyle Cover Lifter', '<p style=\"color: rgb(15, 70, 130); font-family: \" open=\"\" sans\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 22.4px;=\"\" outline:=\"\" none=\"\" !important;\"=\"\">Suggested RRP 349.95</p><p style=\"color: rgb(15, 70, 130); font-family: \" open=\"\" sans\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 22.4px;=\"\" outline:=\"\" none=\"\" !important;\"=\"\"><br></p><p style=\"color: rgb(15, 70, 130); font-family: \" open=\"\" sans\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 22.4px;=\"\" outline:=\"\" none=\"\" !important;\"=\"\">Thanks to our exclusive, adjustable mounting base that slides beneath the spa, the CoverMate Freestyle delivers when other lifts cant.</p><h3 style=\"font-family: \" open=\"\" sans\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" color:=\"\" rgb(12,=\"\" 165,=\"\" 224);=\"\" margin-bottom:=\"\" 4px;=\"\" font-size:=\"\" 1.8rem;=\"\" text-transform:=\"\" uppercase;=\"\" outline:=\"\" none=\"\" !important;\"=\"\">FEATURES & SPECS</h3><ul style=\"padding-left: 0px; color: rgb(15, 70, 130); font-family: \" open=\"\" sans\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 22.4px;=\"\" outline:=\"\" none=\"\" !important;\"=\"\"><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\" ..=\"\" images=\"\" bluecross.svg\")=\"\" left=\"\" 5px=\"\" no-repeat=\"\" scroll=\"\" transparent;\"=\"\">Requires approximately 20 inches of clearance behind the spa</li><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\" ..=\"\" images=\"\" bluecross.svg\")=\"\" left=\"\" 5px=\"\" no-repeat=\"\" scroll=\"\" transparent;\"=\"\">Designed to work on round and uniquely shaped spas</li><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\" ..=\"\" images=\"\" bluecross.svg\")=\"\" left=\"\" 5px=\"\" no-repeat=\"\" scroll=\"\" transparent;\"=\"\">Adjustable mounting base simply slides under the spa</li><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\" ..=\"\" images=\"\" bluecross.svg\")=\"\" left=\"\" 5px=\"\" no-repeat=\"\" scroll=\"\" transparent;\"=\"\">Works on nearly any spa up to 45 inches tall and 86 inches wide</li></ul>', 'crmaccessory_63384.jpg', '2016-11-26 10:43:41', '2016-12-19 14:01:48', NULL),
(7, 2, 10, 'l4yt-5mh5-nrmx-vgqo', 169, 0, 1, 'CoverMate III DeckMount Cover Lifter', '<p style=\"color: rgb(15, 70, 130); font-family: \" open=\"\" sans\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 22.4px;=\"\" outline:=\"\" none=\"\" !important;\"=\"\">Suggested RRP £359.95 </p><p style=\"color: rgb(15, 70, 130); font-family: \" open=\"\" sans\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 22.4px;=\"\" outline:=\"\" none=\"\" !important;\"=\"\"><br></p><p style=\"color: rgb(15, 70, 130); font-family: \" open=\"\" sans\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 22.4px;=\"\" outline:=\"\" none=\"\" !important;\"=\"\">No other hydraulic cover lift offers the beauty, reliability and superior operation of the CoverMate III. Our exclusive wind lock system is the only one of its kind  designed to eliminate broken shock syndrome that other hydraulic lifts experience. Combine that with an aluminum full-frame construction and our stylish composite mounting brackets, and you\/\'ve given your customers a perfect option with no heavy lifting.</p><h3 style=\"font-family: \" open=\"\" sans\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" color:=\"\" rgb(12,=\"\" 165,=\"\" 224);=\"\" margin-bottom:=\"\" 4px;=\"\" font-size:=\"\" 1.8rem;=\"\" text-transform:=\"\" uppercase;=\"\" outline:=\"\" none=\"\" !important;\"=\"\">FEATURES & SPECS</h3><ul style=\"padding-left: 0px; color: rgb(15, 70, 130); font-family: \" open=\"\" sans\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 22.4px;=\"\" outline:=\"\" none=\"\" !important;\"=\"\"><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\" ..=\"\" images=\"\" bluecross.svg\")=\"\" left=\"\" 5px=\"\" no-repeat=\"\" scroll=\"\" transparent;\"=\"\">Requires just 6 inches of clearance behind the spa</li><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\" ..=\"\" images=\"\" bluecross.svg\")=\"\" left=\"\" 5px=\"\" no-repeat=\"\" scroll=\"\" transparent;\"=\"\">Powder-coated, aluminum tubing</li><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\" ..=\"\" images=\"\" bluecross.svg\")=\"\" left=\"\" 5px=\"\" no-repeat=\"\" scroll=\"\" transparent;\"=\"\">Euro-styled composite brackets with beauty covers that hide mounting hardware for a clean look</li><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\" ..=\"\" images=\"\" bluecross.svg\")=\"\" left=\"\" 5px=\"\" no-repeat=\"\" scroll=\"\" transparent;\"=\"\">Ergonomically designed for ease of use</li><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\" ..=\"\" images=\"\" bluecross.svg\")=\"\" left=\"\" 5px=\"\" no-repeat=\"\" scroll=\"\" transparent;\"=\"\">Available with extended pivot arms and extended brackets for larger spas</li><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\" ..=\"\" images=\"\" bluecross.svg\")=\"\" left=\"\" 5px=\"\" no-repeat=\"\" scroll=\"\" transparent;\"=\"\">Available with optional DeckMount bracket system (sold separately)</li></ul>', 'crmaccessory_33912.jpg', '2016-11-26 10:46:19', '2017-01-17 14:05:03', NULL),
(8, 2, 10, '2a6y-nqei-lfix-f10a', 81, 20, 1, 'Cover Rock It Cover Lifter', '<p><span style=\"color: rgb(4, 117, 93); font-family: \" pt=\"\" sans=\"\" narrow\",=\"\" arial,=\"\" helvetica,=\"\" sans-serif;=\"\" font-size:=\"\" 18px;=\"\" line-height:=\"\" 28px;=\"\" text-align:=\"\" center;\"=\"\">Suggested RRP £149</span></p><p><span style=\"color: rgb(4, 117, 93); font-family: \" pt=\"\" sans=\"\" narrow\",=\"\" arial,=\"\" helvetica,=\"\" sans-serif;=\"\" font-size:=\"\" 18px;=\"\" line-height:=\"\" 28px;=\"\" text-align:=\"\" center;\"=\"\"><br></span></p><p><span style=\"color: rgb(4, 117, 93); font-family: \" pt=\"\" sans=\"\" narrow\",=\"\" arial,=\"\" helvetica,=\"\" sans-serif;=\"\" font-size:=\"\" 18px;=\"\" line-height:=\"\" 28px;=\"\" text-align:=\"\" center;\"=\"\">The Cover Rock-It is a superior cover lift that offers a simplistic design. It fits most of todays spas up to 96?, all the while offering ease of use and affordability. The Cover Rock-It slides effortlessly behind the spa enabling a view from all sides. While the spa is in use the Rock-It reduces cover wear and tear by keeping the cover off of the ground. The powder coated finish in addition to the improved frame strength ensures years of effortless spa cover removal.</span><br></p><ul style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: 20.02px;\"><li>Under-spa plates are held securely in place by the weight of the spa.</li><li>Requires as little as 18? of clearance.</li><li>When folded down, the cover stores neatly on the side of spa to provide a full view.</li><li>Zinc-plated and powder coated finish.</li><li>Fits most spas up to 96?.</li></ul>', 'crmaccessory_79037.jpg', '2016-11-26 10:48:24', '2017-01-17 14:06:15', NULL),
(9, 2, 10, 'v2fi-ucdc-2ik6-tc47', 41, 0, 1, 'Cover Catch Cover Lifter', '<p style=\"color: rgb(15, 70, 130); font-family: \" open=\"\" sans\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 22.4px;=\"\" outline:=\"\" none=\"\" !important;\"=\"\">Suggested RRP 65.00</p><p style=\"color: rgb(15, 70, 130); font-family: \" open=\"\" sans\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 22.4px;=\"\" outline:=\"\" none=\"\" !important;\"=\"\"><br></p><p style=\"color: rgb(15, 70, 130); font-family: \" open=\"\" sans\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 22.4px;=\"\" outline:=\"\" none=\"\" !important;\"=\"\">The CoverCatch is the perfect answer for keeping the cover close-by and off the ground. Install the arms low on the spa for an unobstructed view, or higher for added privacy. Ideal for the smaller sized spa and cover.</p><h3 style=\"font-family: \" open=\"\" sans\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" color:=\"\" rgb(12,=\"\" 165,=\"\" 224);=\"\" margin-bottom:=\"\" 4px;=\"\" font-size:=\"\" 1.8rem;=\"\" text-transform:=\"\" uppercase;=\"\" outline:=\"\" none=\"\" !important;\"=\"\">FEATURES & SPECS</h3><ul style=\"padding-left: 0px; color: rgb(15, 70, 130); font-family: \" open=\"\" sans\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 22.4px;=\"\" outline:=\"\" none=\"\" !important;\"=\"\"><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\" ..=\"\" images=\"\" bluecross.svg\")=\"\" left=\"\" 5px=\"\" no-repeat=\"\" scroll=\"\" transparent;\"=\"\">Requires just 10 inches of clearance behind the spa</li><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\" ..=\"\" images=\"\" bluecross.svg\")=\"\" left=\"\" 5px=\"\" no-repeat=\"\" scroll=\"\" transparent;\"=\"\">Arms fold flat against spa when not in use</li><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\" ..=\"\" images=\"\" bluecross.svg\")=\"\" left=\"\" 5px=\"\" no-repeat=\"\" scroll=\"\" transparent;\"=\"\">Works well on most smaller spas regardless of shape</li><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\" ..=\"\" images=\"\" bluecross.svg\")=\"\" left=\"\" 5px=\"\" no-repeat=\"\" scroll=\"\" transparent;\"=\"\">Foam-rubber pads provide soft, slip-free surface for the cover to rest on</li><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\" ..=\"\" images=\"\" bluecross.svg\")=\"\" left=\"\" 5px=\"\" no-repeat=\"\" scroll=\"\" transparent;\"=\"\">Each arm is 7 1/2\" deep</li></ul>', 'crmaccessory_92726.jpg', '2016-11-26 10:53:21', '2016-12-19 14:00:45', NULL),
(10, 2, 10, '8pup-qawd-wfpv-lvmb', 71, 0, 1, 'Cover Shelf Cover Lifter', '<p style=\"color: rgb(15, 70, 130); font-family: \" open=\"\" sans\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 22.4px;=\"\" outline:=\"\" none=\"\" !important;\"=\"\">Suggested RRP £139.95</p><p style=\"color: rgb(15, 70, 130); font-family: \" open=\"\" sans\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 22.4px;=\"\" outline:=\"\" none=\"\" !important;\"=\"\"><br></p><p style=\"color: rgb(15, 70, 130); font-family: \" open=\"\" sans\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 22.4px;=\"\" outline:=\"\" none=\"\" !important;\"=\"\">It\/\'s hard to imagine a more simple or effective method of cover removal and storage than the CoverShelf. Simply fold the cover in half and slide it out onto the sturdy aluminum bars, where it can rest securely without obstructing the view.</p><h3 style=\"font-family: \" open=\"\" sans\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" color:=\"\" rgb(12,=\"\" 165,=\"\" 224);=\"\" margin-bottom:=\"\" 4px;=\"\" font-size:=\"\" 1.8rem;=\"\" text-transform:=\"\" uppercase;=\"\" outline:=\"\" none=\"\" !important;\"=\"\">FEATURES & SPECS</h3><ul style=\"padding-left: 0px; color: rgb(15, 70, 130); font-family: \" open=\"\" sans\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 22.4px;=\"\" outline:=\"\" none=\"\" !important;\"=\"\"><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\" ..=\"\" images=\"\" bluecross.svg\")=\"\" left=\"\" 5px=\"\" no-repeat=\"\" scroll=\"\" transparent;\"=\"\">Shelf arms fold flat against spa when not in use</li><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\" ..=\"\" images=\"\" bluecross.svg\")=\"\