(15, 6, 2, '0uq8-x55z-g1x2-2ozv', 37, 10, 1, 'Spa Caddy Tray', '<p>Suggested RRP £59.95</p><p><br></p><p style=\"color: rgb(119, 119, 119); font-family: \"Open Sans\", sans-serif; font-size: 14px; line-height: 18px;\">Keeping close to your favorite drink or snack can be easy, as the Caddy is fixed onto a stainless steel upright post with a central pivot which allows it to swing in or out of the spa.</p><p style=\"color: rgb(119, 119, 119); font-family: \"Open Sans\", sans-serif; font-size: 14px; line-height: 18px;\">The Caddy is large enough to hold a range of item and suitable for mounting on almost any spa. </p><p style=\"color: rgb(119, 119, 119); font-family: \"Open Sans\", sans-serif; font-size: 14px; line-height: 18px;\"><br></p><p style=\"color: rgb(119, 119, 119); font-family: \"Open Sans\", sans-serif; font-size: 14px; line-height: 18px;\">Made from reinforced weather resistant plastic</p><p style=\"color: rgb(119, 119, 119); font-family: \"Open Sans\", sans-serif; font-size: 14px; line-height: 18px;\"><br></p><p style=\"color: rgb(119, 119, 119); font-family: \"Open Sans\", sans-serif; font-size: 14px; line-height: 18px;\">Stainless Steel attachments that are easily fitted to the cabinet.</p><p style=\"color: rgb(119, 119, 119); font-family: \"Open Sans\", sans-serif; font-size: 14px; line-height: 18px;\"><br></p><p style=\"color: rgb(119, 119, 119); font-family: \"Open Sans\", sans-serif; font-size: 14px; line-height: 18px;\">Size of tray is 27\" x 19\" - 27 inches at the longest part and 19 inches at the widest.</p>', 'crmaccessory_88355.jpg', '2016-11-26 11:10:17', NULL, NULL),
(16, 6, 2, '0hkz-031s-took-lsd4', 81, 3, 1, 'Safe - T - Rail', '<p style=\"color: rgb(15, 70, 130); font-family: \"Open Sans\", Helvetica, Arial, sans-serif; font-size: 14px; line-height: 22.4px; outline: none !important;\">Suggested RRP £169.99</p><p style=\"color: rgb(15, 70, 130); font-family: \"Open Sans\", Helvetica, Arial, sans-serif; font-size: 14px; line-height: 22.4px; outline: none !important;\"><br></p><p style=\"color: rgb(15, 70, 130); font-family: \"Open Sans\", Helvetica, Arial, sans-serif; font-size: 14px; line-height: 22.4px; outline: none !important;\">The combination of water and slippery surfaces makes every spa a potential hazard. That\/\'s why we invented Safe-T-Rail. We believe this product has more upside sales potential than any other product we offer. Don\/\'t let a single customer-young or old-leave your showroom without considering a Safe-T-Rail for their spa.</p><h3 style=\"font-family: \"Open Sans\", Helvetica, Arial, sans-serif; color: rgb(12, 165, 224); margin-bottom: 4px; font-size: 1.8rem; text-transform: uppercase; outline: none !important;\">FEATURES & SPECS</h3><ul style=\"padding-left: 0px; color: rgb(15, 70, 130); font-family: \"Open Sans\", Helvetica, Arial, sans-serif; font-size: 14px; line-height: 22.4px; outline: none !important;\"><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\"../images/bluecross.svg\") left 5px no-repeat scroll transparent;\"><div style=\"outline: none !important;\">Ultra sturdy construction</div></li><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\"../images/bluecross.svg\") left 5px no-repeat scroll transparent;\">5-minute installation</li><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\"../images/bluecross.svg\") left 5px no-repeat scroll transparent;\">Two composite mounting brackets with 8 screws each</li><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\"../images/bluecross.svg\") left 5px no-repeat scroll transparent;\"><div style=\"outline: none !important;\">Slip-free, black foam grip</div></li><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\"../images/bluecross.svg\") left 5px no-repeat scroll transparent;\"><div style=\"outline: none !important;\">Mounts on most above-ground spas</div></li><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\"../images/bluecross.svg\") left 5px no-repeat scroll transparent;\">Available in polished stainless steel and rust-free powder-coated aluminum</li></ul>', 'crmaccessory_77045.jpg', '2016-11-26 11:13:17', '2017-01-12 13:50:52', NULL),
(17, 6, 2, 'fxx5-1wl3-t70o-nbi7', 20, 5, 1, 'Towel Rail', '<p>Suggested RRP £34.95</p><p><br></p><h2 style=\"font-family: \"Open Sans\", Helvetica, Arial, sans-serif; color: rgb(12, 165, 224); margin-top: 0px; margin-bottom: 4px; font-size: 2.1rem; text-transform: uppercase; outline: none !important;\">THE SMART, CONVENIENT WAY TO KEEP TOWELS CLOSE, CLEAN AND DRY</h2><p style=\"color: rgb(15, 70, 130); font-family: \"Open Sans\", Helvetica, Arial, sans-serif; font-size: 14px; line-height: 22.4px; outline: none !important;\">TowelBar is one of those deceptively simple products that makes all the difference in spa convenience. It holds towels a short distance away from splashing water and steam and conveniently folds flat against the spa side when not in use.</p><h3 style=\"font-family: \"Open Sans\", Helvetica, Arial, sans-serif; color: rgb(12, 165, 224); margin-bottom: 4px; font-size: 1.8rem; text-transform: uppercase; outline: none !important;\">FEATURES & SPECS</h3><ul style=\"padding-left: 20px; color: rgb(15, 70, 130); font-family: \"Open Sans\", Helvetica, Arial, sans-serif; font-size: 14px; line-height: 22.4px; outline: none !important;\"><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\"../images/bluecross.svg\") left 5px no-repeat scroll transparent;\">Folds flat or opens away from the spa to keep towels dry</li><li style=\"list-style-type: none; padding-left: 17px; margin-bottom: 6px; outline: none !important; background: url(\"../images/bluecross.svg\") left 5px no-repeat scroll transparent;\">Easy installation</li></ul>', 'crmaccessory_76369.jpg', '2016-11-26 11:17:03', NULL, NULL),
(18, 7, 2, 'law3-yu4q-06vc-p4z7', 13, 48, 1, 'RD50 Filter', '<p>RRP £25 </p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><span style=\"font-weight: bold; text-decoration: underline;\">Suitable for: </span></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">RELAX, HAPPY, REFRESH, PALMA. </p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><span style=\"font-weight: bold; text-decoration: underline;\"><br></span></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><span style=\"font-weight: bold;\">Outside Diameter:</span> 4 15/16\" (12.5cm) <br></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><span style=\"font-weight: bold;\">Top Finish: </span>2 1/8\" (5.4cm) hole </p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><span style=\"font-weight: bold;\">Bottom Finish:</span> 2 1/8\" (5.4cm) </p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><span style=\"font-weight: bold;\">Hole Length:</span> 13 5/16\" (33.8cm) </p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><span style=\"font-weight: bold;\">Pleatco Reference:</span> PRB501N </p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><span style=\"font-weight: bold;\">Unicel Reference: </span>C-4950 </p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><span style=\"font-weight: bold;\">Filbur Reference:</span> FC-2390 </p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><span style=\"font-weight: bold;\">Great Barrier Reference:</span> 8510 </p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><span style=\"font-weight: bold;\">Pleat Count:</span> 212</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><br></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">Cleaning your hot tub filter is a vital part of hot tub maintenance and plays a key role in keeping your tub\/\'s water safe and clean. While cleaning your hot tub filter may seem complex and cumbersome, it can actually be quite simpleparticularly if you have a good set of instructions at your disposal. This article will walk you through the most common ways to keep your tub\/\'s filter spotless.</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><br></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">Tip 1: Annual Replacement</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><br></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">Regardless of how clean you keep your tub\/\'s filter, it is imperative that you replace it at least once a year. In addition to putting a severe strain on your tub\/\'s pump, worn-out tub filters are unable to properly trap contaminants. Nothing lasts foreverespecially tub filters.</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><br></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">Tip 2: Basic Rinsing</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><br></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">Your tub\/\'s filter should be given a thorough rinsing once every 2 weeks. If you make frequent use of your tub, however, you may want to utilize this method of filter-cleaning on a somewhat more frequent basis. This method is very simple and can often be accomplished with nothing more than a garden hose. Taking care to remove every speck of dirt, use the hose to give your filter a vigorous soaking. If the filter is particularly dirty, all-natural cleaning products can be used in conjunction with this method. It is also important to rinse your filter off in this fashion whenever you change the water in your tub, regardless of how recently its last cleaning took place.</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><br></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">Tip 3: Filter-Cleaning Cartridges</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><br></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">If you want to keep your tub\/\'s filter clean but aren\/\'t a big fan of elbow grease, filter-cleaning cartridges may be right up your alley. Simply attach these cartridges to your garden hose, then attach your filter to the cartridge and spray. As you spray the hose, the cartridge will gently rotate, meticulously cleaning every inch of the filter. Within minutes, your filter should be as good as new.</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><br></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">Tip 4: Cleaning Products</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><br></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">If your tub\/\'s filter is exceptionally dirtyor plagued with an all-too-common buildup of calcium scalesyou may want to consider incorporating the aid of cleaning products. Acid Magic is particularly well-respected among filter cleaners, as it has proven extremely effective in laying waste to caked-on dirt and calcium. Should you decide to use cleaning products for filter-cleaning, it is strongly advised that you chose something all-natural and make sure that the product is intended for cleaning filters. Chemicals and detergents found in many household products can cause foaming problems with the water in your hot tub, so when scrubbing that filter, Mother Nature is a responsible hot tub owner\/\'s best friend.</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><br></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">Tip 5: Mistakes to Avoid</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><br></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">When cleaning your hot tub filter, there are several things you should avoid. First off, do not attempt to clean your hot tub filter in a washing machine or dish washer, as the immense water pressure can damage the filter irreparably. Secondly, do not try to clean your filter with bleach or laundry detergents, as they will cause severe foaming problems with your hot tub\/\'s water, much like other commercial cleaning products.</p><p><br></p>', 'crmaccessory_85056.jpg', '2016-11-26 11:29:57', '2017-01-23 14:12:09', NULL),
