\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">filter cartridge from being a nest for bacteria, mold and algae that can cause odours and product deterioration.</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">Microban® antimicrobial protection is built into products during manufacturing to provide continuous antimicrobial</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">product protection.</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">Microbes or micro-organisms are living cells that are too small to be seen with the naked eye. Microbes such as</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">bacteria, mould and mildew can double every 20 minutes. In some cases, algae can damage product surfaces</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">such as your spa pool filter. Microban® penetrates the cell wall of these micro-organisms making them unable to</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">function, grow and re-produce. Microban® protection works continuously... for the lifetime of your Spa Industries</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">Filter Cartridge.</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\