(21, 7, 2, '3wzm-ywzd-uo2n-wyhu', 13, 85, 1, 'RD35 Filter', '<p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><span style=\"font-weight: bold;\">Suggested RRP £25</span></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><span style=\"font-weight: bold;\"><br></span></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><span style=\"font-weight: bold;\">Suitable for:</span><br></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">Bliss, Mars, Dream, Venus, Paradise, Saturn, Fiji, Rio 200, Rio 218, Pluto, Manhattan, Palermo. </p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><br></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><span style=\"font-weight: bold;\">Length</span> 235mm</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><span style=\"font-weight: bold;\">Diameter </span>125mm</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><span style=\"font-weight: bold;\">Top Detail</span> 54mm hole</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><span style=\"font-weight: bold;\">Bottom Detail</span> 54mm hole</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><span style=\"font-weight: bold;\">Filter Area Sq Ft</span> 35</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><br></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><span style=\"font-weight: bold;\">Magnum</span> RD35</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><span style=\"font-weight: bold;\">Plearco </span>PRB35IN</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><span style=\"font-weight: bold;\">Unicel</span> C$335</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><span style=\"font-weight: bold;\">Filbur</span> FC-2385</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><span style=\"font-weight: bold;\">Darlly</span> 40353</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><br></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">Cleaning your hot tub filter is a vital part of hot tub maintenance and plays a key role in keeping your tub\/\'s water safe and clean. While cleaning your hot tub filter may seem complex and cumbersome, it can actually be quite simpleparticularly if you have a good set of instructions at your disposal. This article will walk you through the most common ways to keep your tub\/\'s filter spotless.</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><br></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">Tip 1: Annual Replacement</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><br></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">Regardless of how clean you keep your tub\/\'s filter, it is imperative that you replace it at least once a year. In addition to putting a severe strain on your tub\/\'s pump, worn-out tub filters are unable to properly trap contaminants. Nothing lasts foreverespecially tub filters.</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><br></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">Tip 2: Basic Rinsing</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><br></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">Your tub\/\'s filter should be given a thorough rinsing once every 2 weeks. If you make frequent use of your tub, however, you may want to utilize this method of filter-cleaning on a somewhat more frequent basis. This method is very simple and can often be accomplished with nothing more than a garden hose. Taking care to remove every speck of dirt, use the hose to give your filter a vigorous soaking. If the filter is particularly dirty, all-natural cleaning products can be used in conjunction with this method. It is also important to rinse your filter off in this fashion whenever you change the water in your tub, regardless of how recently its last cleaning took place.</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><br></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">Tip 3: Filter-Cleaning Cartridges</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><br></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">If you want to keep your tub\/\'s filter clean but aren\/\'t a big fan of elbow grease, filter-cleaning cartridges may be right up your alley. Simply attach these cartridges to your garden hose, then attach your filter to the cartridge and spray. As you spray the hose, the cartridge will gently rotate, meticulously cleaning every inch of the filter. Within minutes, your filter should be as good as new.</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><br></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">Tip 4: Cleaning Products</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><br></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">If your tub\/\'s filter is exceptionally dirtyor plagued with an all-too-common buildup of calcium scalesyou may want to consider incorporating the aid of cleaning products. Acid Magic is particularly well-respected among filter cleaners, as it has proven extremely effective in laying waste to caked-on dirt and calcium. Should you decide to use cleaning products for filter-cleaning, it is strongly advised that you chose something all-natural and make sure that the product is intended for cleaning filters. Chemicals and detergents found in many household products can cause foaming problems with the water in your hot tub, so when scrubbing that filter, Mother Nature is a responsible hot tub owner\/\'s best friend.</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><br></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">Tip 5: Mistakes to Avoid</p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\"><br></p><p style=\"color: rgb(119, 119, 119); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" line-height:=\"\" 18px;\"=\"\">When cleaning your hot tub filter, there are several things you should avoid. First off, do not attempt to clean your hot tub filter in a washing machine or dish washer, as the immense water pressure can damage the filter irreparably. Secondly, do not try to clean your filter with bleach or laundry detergents, as they will cause severe foaming problems with your hot tub\/\'s water, much like other commercial cleaning products.</p>', 'crmaccessory_96210.png', '2016-11-26 11:48:09', '2017-02-01 12:34:58', NULL),
