(27, 1, 1, 'yvgb-nqgh-hijy-gj4x', 45, 92, 1, 'Wellis Crystal', '<p>RRP £85.00</p><p style=\"color: rgb(119, 119, 119); font-family:;\" 18px;\"=\"\" 14px;=\"\" sans-serif;=\"\" sans\",=\"\" open=\"\">Wellis crystal is an environmentally friendly water care <br>system that can be used in your spa or hot tub. <br>Wellis crystal will help you to keep the water in your <br>spa clean,in a safe,simple and effective way. <br><br>With only one weekly treatment Wellis crystal will help <br>you prevent calcium deposits in your system. <br><br>Wellis crystal will loosen and remove existing <br>calcium deposits. These calcium deposits are the medium where <br>bacteria and other micro-organisms grow. <br>The ozone or UV-system already in your spa will <br>do the rest. It will destroy the bacteria and <br>disinfect the water, with extraordinary results.</p><p style=\"color: rgb(119, 119, 119); font-family:;\" 18px;\"=\"\" 14px;=\"\" sans-serif;=\"\" sans\",=\"\" open=\"\"><br></p><h2 style=\"padding: 0px; border: currentColor; border-image: none; color: rgb(104, 104, 104); font-family: BrownLight; font-size: 34px; margin-right: 0px; margin-bottom: 16px; margin-left: 5px;\"><font class=\"goog-text-highlight\" style=\"position: relative; box-shadow: 2px 2px 4px rgb(153,153,170); background-color: rgb(201, 215, 241);\">Wellis Crystal Chemical Package</font></h2><p style=\"padding: 0px; border: currentColor; border-image: none; color: rgb(89, 89, 89); line-height: 16px; font-family: BrownLight; font-size: 14px;\"><span style=\"margin: 0px; padding: 0px; border: currentColor; border-image: none; font-family: HelveticaBold, HelveticaLight, HelveticaNeue, Helvetica; font-weight: 700;\">The bucket includes:</span><br>- 2 liters of 100% organic Watertreatment <br>- 1 kg of chlorine tablets <br>- one dispenser <br>- 1 microfiber cleaning cloth <br>- Operating Instructions</p>', 'crmaccessory_48147.jpg', '2016-11-26 12:29:01', '2017-02-06 12:39:03', NULL),
