(41, 6, 10, 'rwur-urwj-mvim-wx6s', 212, 1, 1, 'Cream Spa Parasol/Umbrella', '<p style=\"font-size: 14px; line-height: 18px; color: rgb(119, 119, 119); font-family: \"Roboto Slab\", sans-serif;\">RRP £349.00 </p><p style=\"font-size: 14px; line-height: 18px; color: rgb(119, 119, 119); font-family: \"Roboto Slab\", sans-serif;\"><br></p><p style=\"font-size: 14px; line-height: 18px; color: rgb(119, 119, 119); font-family: \"Roboto Slab\", sans-serif;\">The <span style=\"font-weight: 700;\">Spa Side Umbrella</span> is the leading alternative to traditional gazebos. Its versatility allows for 360 degrees of travel as well as a crank and tilt mechanism that affords trouble free operation. This stylish product will compliment any spa environment all the while protecting the spa owner from the elements. The <span style=\"font-weight: 700;\">Spa Side Umbrella</span> is available in 3 stylish colors and requires no hardware or assembly.</p><p style=\"font-size: 14px; line-height: 18px; color: rgb(119, 119, 119); font-family: \"Roboto Slab\", sans-serif;\"><br></p><div id=\"featureContent\" class=\"grid_6 alpha cushycms\" style=\"font-size: 14px; line-height: 18px; color: rgb(119, 119, 119); font-family: \"Roboto Slab\", sans-serif;\"><ul class=\"push_1\" style=\"list-style: inside;\"><li>No hardware required.</li><li>Base features durable zinc plated and color-matched powder coat finish.</li><li>Umbrella frame constructed of powder coated aluminum.</li><li>Available in 3 attractive colors that add style to any spa environment.</li><li>Swivels 360º.</li><li>Umbrella easily removes from base for storage.</li><li>Umbrella folds neatly to side of spa when not in use.</li><li>Umbrella is fully assembled and ready to operate.</li><li>The <span style=\"font-weight: 700;\">Spa Side Umbrella</span> is backed by a complete one year warranty. Umbrellas in general are prone to wind damage, therefore any wind-related damage incurred by the<span style=\"font-weight: 700;\">Spa Side Umbre